import React, {useContext} from 'react'
import { Link } from 'react-router-dom'
import { OpenWorkspacesContext } from '../Contexts/openWorkspacesContext';

const WorkspaceRowCard = ({workspace}) => {
    const {addOpenWorkspaces} = useContext(OpenWorkspacesContext);

    return (
        <Link to={`/workspace/${workspace._id}`} className="workspace-card" onClick={() => {addOpenWorkspaces(workspace._id, workspace.title)}}>
            {workspace.title}
        </Link>
    )
}

export default WorkspaceRowCard
